function App() {
  return (
    <Router>
      <div className="App">
        {/* Header, navigation, or other common components can go here */}

        <Sidebar/>
        <Navbar/>

        <Routes>
          <Route path="/" element={<Home />} />
        <Route path="/auth" element={<AuthComponent/>} />
        <Route path="/blog" element={<Blog/>} />
        <Route path="/createpost" element={<CreatePost/>} />
        </Routes>
      </div>

      <Footer/>

    </Router>
  );
}

export default App;
